import profile_pic from './../../profile_pic.JPEG'
import home from './home.css'

function Home() {
	const logo = require('./../../profile_pic.JPEG');
	return (
		<div className='bg-rose-100'>
			<div className='text-center'>
				<p>Hi, I am Alex Nguyen</p>
				<a  href={require("../../Alex_Resume.pdf")} download="Alex_Nguyen_Resume">Download file</a>
				<p>lets talk</p>
			</div>

			<div className='flex justify-center '>
				<img className='w-2/12 h-2/12 rounded-t-full' src={logo} />
			</div>
			<button class="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded inline-flex items-center">
